import React from "react";
import ReactDom from "react-dom";

class App extends React.Component {
  render() {
    return (
      <div className="ui borderless menu">
        <a>Work</a>
        <a>Github</a>
        <a>About</a>
      </div>
    );
  }
}

ReactDom.render(<App />, document.querySelector("#root"));
